import React,{ Component } from 'react';
import Pelicula from './Pelicula';
class Peliculas extends Component {
    state = {
        peliculas: [
            { titulo: 'Batman vs Superman', image: 'data:image/jpeg;base64,' },
            { titulo: 'Gran Torino', image: 'data:image/jpeg;base64,'},
            { titulo: 'Titanic', image: 'data:image/jpeg;base64,'},
        ],
        nombre : 'Daniel Gil Garcia',
        favorita: {}
    };
 // modifica el elemento que viene del array peliculas
    cambiarTitulo = () => {
        
        var { peliculas } = this.state;
        //var random = Math.floor(Math.random()*3)
        
        peliculas[0].titulo = 'Batman Begins';

        this.setState({
            peliculas: peliculas
        });
    }


    favorita = (pelicula, indice) =>{
        console.log("Favorita Marcada");
        console.log(indice);
        this.setState({
            favorita: pelicula
            
        });
    }

    render (){
        var pStyle = {
            background:'green',
            color: 'white',
            padding: '10px',
            }


        return(
        <div id="content" className="peliculas">
            <h2 className="subheader">Peliculas</h2>
            <p>Seleccion de las peliculas favoritas de {this.state.nombre}</p>
            <p>
                <button onClick={this.cambiarTitulo}>Cambiar_titulo</button>
            </p>

{/*   condicional  */}
            {this.state.favorita.titulo &&
                <p className="favorita" style={pStyle}>
                <strong>La peliculas favorita es: </strong>
                <span>{this.state.favorita.titulo}</span>
                </p>
            }


            
            { /*crear componente pelicula */ }
            <div id='articules'>
            {
                this.state.peliculas.map((pelicula,i) => {
                    return(
                        <Pelicula 
                            key={i} 
                            pelicula={pelicula}
                            indice={i}
                            marcarFavorita={this.favorita}
                         />
                    )
                })     
            }
            </div>
        </div>
        )
    };
}


export default Peliculas;